#include "scope_waveform_data.h"
#include "waterfall.h"
#include "ic7300.h"

// The purpose of this file now is to create fake scope data commands
// ('27 00 00') from the radio so I don't have to constantly be hammering
// on the radio while getting bugs out of the code. Like serial.cxx, stuff
// here calls into ic7300 with a buffer and length from a seperate thread.
// The buffer and length are just replayed captured '27 00 00's.

static void *scope_waveform_thread_loop(void *d);
static void fake_cmd_from_radio(void);

static bool run_scope_waveform_thread = true;
static pthread_t *scope_waveform_thread = 0;
static pthread_mutex_t mutex_scope_waveform = PTHREAD_MUTEX_INITIALIZER;

static const int FAKE_SCOPE_DATA_DIV_1_ARRAY_SIZE = 12 * 3;

void start_scope_waveform_thread()
{
    puts("start_scope_waveform_thread: creating thread");
    scope_waveform_thread = new pthread_t;
    if (pthread_create(scope_waveform_thread, NULL, scope_waveform_thread_loop, NULL)) {
        puts("start_scope_waveform_thread: error creating thread");
        exit(1);
    }
}

void stop_scope_waveform_thread()
{
    puts("stop_scope_waveform_thread: stopping thread");

    pthread_mutex_lock(&mutex_scope_waveform);
    run_scope_waveform_thread = false;
    pthread_mutex_unlock(&mutex_scope_waveform);

    puts("Joining Scope Waveform Thread");
    pthread_join(*scope_waveform_thread, NULL);
    puts("Joined");

    puts("stop_scope_waveform_thread: thread stopped");
}

static void *scope_waveform_thread_loop(void *d)
{
    useconds_t usec;
    bool run = true;

    while(run) {
        switch(waterfall::get_waterfall()->Speed()) {
            case PAUSE:
                usec = 100000ul;
                break;
            case FAST:
                fake_cmd_from_radio();
                usec = 5000ul;
                break;
            case NORMAL:
                fake_cmd_from_radio();
                usec = 20000ul;
                break;
            case SLOW:
            default:
                fake_cmd_from_radio();
                usec = 500000ul;
                break;
        }

        usleep(usec);

        pthread_mutex_lock(&mutex_scope_waveform);
        run = run_scope_waveform_thread;
        pthread_mutex_unlock(&mutex_scope_waveform);
    }

    return NULL;
}

